import java.util.HashMap;
import java.util.Map.Entry;

public class AnagramFinder {
    /*
    Given two strings s and t, write a function to determine if t is an anagram of s.

For example,
s = "anagram", t = "nagaram", return true.
s = "rat", t = "car", return false.

Note:
You may assume the string contains only lowercase alphabets.
    */
    
    public boolean isAnagram(String s, String t) {
        
        if(s==null || t==null||s==""||t==""||s.length()!=t.length())
         return false;
        System.err.println(s.length());
        char[] ch1 = s.toCharArray();
        char[] ch2 = t.toCharArray();
        
        HashMap<String,Integer> ch_map1= new HashMap<String,Integer>();
        HashMap<String,Integer> ch_map2= new HashMap<String,Integer>();
        //O(1)
        for(char c = 'a'; c <= 'z';c++)
        {
         ch_map1.put(String.valueOf(c),0);
         ch_map2.put(String.valueOf(c),0);
        }
        //O(n)
        for(int i=0;i<s.length();i++)
        {
            String key_Str = String.valueOf(s.charAt(i));
            int v = (int)ch_map1.get(key_Str);            
            ch_map1.put(key_Str,++v);
            
            String key_Str2 = String.valueOf(t.charAt(i));
            int v2 =(int) ch_map2.get(key_Str2);            
            ch_map2.put(key_Str2,++v2);
        }
        //O(n)
        for(Entry<String, Integer> es : ch_map1.entrySet())
        {
            if(ch_map2.get(es.getKey()) != es.getValue()) return false;
        }
        
        return true;
    }

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		AnagramFinder a = new AnagramFinder();
		System.out.println(a.isAnagram("", " "));

		
	}
}

